import React from "react";
import { Box, Grid, Avatar, Typography } from "@material-ui/core";
import "./styles.scss";

export default function MemberShip() {
  return (
    <Box className="container-fluid body-account">
      <Box class="container h-100">
        <Grid container className="h-100" spacing={1}>
          <Grid
            item
            xs={3}
            className="d-flex align-items-center justify-content-center"
          >
            <Box
              className="box"
              sx={{
                padding: "30px",
                borderRadius: "3px",
                backgroundColor: "#333",
              }}
            >
              <Avatar
                className="avatar-member"
                src="https://member.aorus.com/images/pic-default.jpg"
              />
              <Typography variant="h5" color="white">
                Nhocvodanh1908
              </Typography>
            </Box>
          </Grid>
          <Grid item xs={9}></Grid>
        </Grid>
      </Box>
    </Box>
  );
}
